    def classify_work(self,Vec):
        id = 0
        dif_angle = 10000000.0
        for i in range(13):
            for j in range(len(self.std_vec[i])):
                tmp = 0.0
                num = 0
                for k in range(len(self.std_vec[i][j])):
                    for f in range(len(Vec)):
                        if Vec[f][0]== self.std_vec[i][j][k][0]:
                            x1 = Vec[f][1]
                            y1 = Vec[f][2]
                            x2 = self.std_vec[i][j][k][1]
                            y2 = self.std_vec[i][j][k][2]
                            cs_theta = (x1*x2+y1*y2)/(math.sqrt(x1*x1+y1*y1)*math.sqrt(x2*x2+y2*y2))
                            if cs_theta>1:
                                cs_theta = 1
                            if cs_theta<-1:
                                cs_theta=-1
                            abs_theta = math.fabs(math.acos(cs_theta))
                            tmp  += abs_theta
                            num += 1
                if num == 0 :
                    return "Unkown"
                tmp/=num
                tmp += (13-num)*0.04
                if tmp < dif_angle:
                    dif_angle = tmp
                    id = i
        print(dif_angle)
        if dif_angle >=0.7:
            return "Unkown"
        return self.pose[id]

